import './OuterBox.css'

function OuterBox(){
    return(
        <div className='outerBox'>
           <p>Course Goal</p>
           <input type='text'></input> 
           <br/>
           <button type='submit'>Add Goal</button>
        </div>
    );
};

export default OuterBox;
